import React from "react";
import { Link } from "react-router-dom";
import "./tailwind.css";

export const Top = () => {
  return (
    <>
      <div>
        <div
          class="flex py-8 justify-center h-64 bg-cover bg-center bg-gradient-to-l rounded-lg
          from-yellow-400 via-green-500 to-blue-500"
        >
          <div>日報を共有して、新たな発見に出会う</div>
        </div>
        <div class="flex py-8 justify-center">
          <Link class="p-4 bg-blue-300 rounded-lg text-white" to="/daily">
            日報を見る
          </Link>
        </div>
      </div>
    </>
  );
};
